const About = () => {
    return <div>
    <h1>About</h1>

    <h2>Why Scanning Sucks</h2>
    <p>Scanning old family photos is time consuming and boring. 
    Scanning software is terrible, like Epson's SmartScan suite and Apple ImageCapture. 
     </p>
     <p> The biggest surprise to me was that scanning multiple photos at once required a preview scan, then confirmation of the photo edges, and an individual scan for each photo. This amounted to about 3 minutes to scan 3 photos, which in my mind is ridiculous.</p>
     </div>;    
};

export default About;
